import React from 'react';
import './home.css';



function Home() {  
    return (
    <div className='container'>
        <div >
            <h1>Việc làm tốt nhất</h1>
        </div>
        <div className='list_job'>
            <div>
                <h2>Solution </h2>
            </div>
        </div>
    </div>
        
    );
}

export default Home;
